def print_alphabet_pattern(n):
    """print a hollow alphabet pattern of height n"""

    for i in range(n):
        # Left side letters
        for j in range(n - i):
            print(chr(ord('A') + j), end="")

        if i == 0:
            # First row: no spaces
            for j in range(n, 2 * n - 1):
                print(chr(ord('A') + j), end="")
        else:
            # Spaces
            for s in range(2 * i - 1):
                print(" ", end="")

            # Right side letters
            for j in range(n - i, n):
                print(chr(ord('A') + j), end="")

        print()  # new line

