def print_alphabet_pattern(n):
    if n <= 0:
        return

    total = 2 * n - 1  
    for i in range(n):
        if i == 0:
            for k in range(total):
                print(chr(65 + k), end='')
        else:
            left = n - i                   
            gap = 2 * i - 1

            for k in range(left):
                print(chr(65 + k), end='')
            print(' ' * gap, end='')


            start = total - left
            for k in range(start, total):
                print(chr(65 + k), end='')

        print()  

