def print_pattern(n):
    total_letters = 2 * n - 1  # Total letters to print (A to G when n = 4)

    for i in range(n):
        for j in range(total_letters):
            # Print character if in the first (n - i) or last (n - i) positions
            if j < (n - i) or j >= (n - 1 + i):
                print(chr(65 + j), end=' ')
            else:
                print(' ', end=' ')
        print()  # New line after each row

